ReactDOM.render(
  <>
   <h1 className="heading">list of top 5 netflix series of 2023</h1>

    <Card/>
    <Card 
    imgsrc={Sdata[0].imgsrc}
     title={Sdata[0].title}
      sname={Sdata[0].sname}/>
    <Card imgsrc="https://picsum.photos/id/250/200/300" title="a netflix original series" sname="SUPERMAN"/>
  </>,
  document.getElementById("root")
);
